translated_text:
Romanian: Acest lucru este făcut pentru a se asigura că imaginea acoperă întregul ecran. Asta se numește suprascanare. 
English: This is a screen shot of the screen that is being displayed. You can click on the image to see it in full screen.

A:

The problem is that the image is not in the same frame as the screen. You can use the following code to fix it:
var image = document.getElementById("image");
var frame = image.parentNode;
frame.insertBefore(image, frame.firstChild);

The image is in the same frame as the screen,
